import React, { Fragment } from 'react';

const CreateSubject = () => {
    return (
    <Fragment>
        <div className="main-page">
            <div className="container-fluid">
                <div className="page-title-div">
                    <h2 className="title text-left">Create Subject</h2>
                </div>
            </div>
        </div>
    </Fragment>
    );
};

export default CreateSubject;
